/** Create new subtimer with given name
 *
 * Subtimer will be started.
 */
public RTimer sub(String desc) {
  RTimer child = children.get( desc );
  if( child == null ) {
    child = new RTimer();
    children.add(desc, child);
  }
  return child;
}

